import React, { Component } from "react";
import axios from "axios";
import OmdbClient from "../../../omdb";
class Movie extends Component {
  state = {
    items: []
  };

  componentWillMount() {
    axios.get("http://localhost:3000/").then(res => {
      this.setState({
        items: res.data
      });
    });
  }

  render() {

    return (
      <React.Fragment>
        <div>
          <table>
            <thead>
              <tr>
                <th>Name:</th>
              </tr>
            </thead>
            <tbody></tbody>
          </table>
        </div>
        <div>
          <OmdbClient />
        </div>
      </React.Fragment>
    );
  }
}

export default Movie;
